INSERT INTO `CosechaMecanica` (`id`, `nombre`, `fecha_apertura`, `fecha_cierre`, `descripcion`, `estado`, `costo_base`, `bon_optima`, `bon_muy_buena`, `bon_buena`, `anticipo`, `created_at`, `updated_at`) VALUES
(4, 'Operativo prueba participación', '2025-11-01', '2025-12-12', '<p class=\"ql-align-justify\">Por medio de la presente LA COOPERATIVA&nbsp;&nbsp;<strong>FERRRRR</strong>…. en adelante LA COOPERATIVA solicita el servicio de cosecha mecánica para ser realizado en la propiedad de sus asociados (en adelante EL/LOS PRODUCTOR/ES) para la cual solicitamos que se fije la superficie a cosechar, la fecha probable de cosecha de cada uno de sus variedades y la cantidad de km desde la finca a la bodega .</p><p class=\"ql-align-justify\"><strong><u>ARTICULO 1°</u></strong><u>. </u><strong><u>OBJETO</u></strong>: El servicio de cosecha de uva se prestará en la propiedad de los productores, cuya lista se encuentra en el Anexo I &nbsp;que integra esta solicitud. </p><p class=\"ql-align-justify\"><strong><u>ARTICULO 2°. PRECIO: </u></strong>El precio &nbsp;del presente servicio tiene una base de USD 730 ( Los precios no incluyen IVA) incluyendo&nbsp;gasoil. </p><p class=\"ql-align-justify\"><strong><u>2°. a ANTICIPO: </u></strong>A los fines de organizar la cosecha, se cobrará un anticipo de USD100 por hectárea con la adhesión al 01/02/2025, descontándose en la cuota de vino a pagar en febrero. </p><p class=\"ql-align-justify\">	<strong><u>2°. B BONIFICACIONES:</u></strong> </p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;LOS PRODUCTORES que se adhieran a la presente solicitud antes del 01/02/2024 y abonen el anticipo se le concederá una bonificación de USD 20 por hectárea.</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Se practicará un descuento de acuerdo con la aptitud de la finca para ser cosechada de manera mecánica.</p><p class=\"ql-align-justify\">Optima:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;USD 30</p><p class=\"ql-align-justify\">Muy buena: USD 20</p><p class=\"ql-align-justify\">Buena:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;USD 10 </p><p class=\"ql-align-justify\">	<strong><u>2°-b. PENALIDADES</u>:&nbsp;</strong></p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em style=\"color: black;\">Aquel PRODUCTOR </em><span style=\"color: black;\">incluido en el Anexo I que, durante el periodo de cosecha, revoque la presente solicitud tendrá un plazo de 10 días para justificar la baja del servicio. LA COOPERATIVA será quien informe por correo la baja de productor junto con su justificación. Si la baja no se justifica con accidente climático perderá automáticamente la seña entregada. </span></p><p class=\"ql-align-justify\"><strong><u>ARTICULO 3°. FLETE DE ACARREO</u></strong>: SVE proporcionará el servicio de acarreo de uva, para ello seleccionará al proveedor más adecuado asegurando la correcta provisión del servicio. SVE efectuará el pago por cuenta y orden de LOS PRODUCTORES &nbsp;desde la ubicación donde se preste el servicio hasta LA COOPERATIVA donde se efectuará la elaboración. El precio del flete lo establecerá SVE convenido con los fleteros. <u>El productor que desee optar por su propio servicio de acarreo</u> deberá notificar al Área de Logística para convenir la cantidad y oportunidad de camiones necesarios. </p><p class=\"ql-align-justify\">Este artículo aplica en las Cooperativas del Oasis Norte, Este y Sur de la provincia</p><p class=\"ql-align-justify\"><strong><u>ARTICULO 4°. OBLIGACIONES DEL PRODUCTOR</u></strong>: LOS PRODUCTORES se comprometen a tener preparada la propiedad cumpliendo con las condiciones especificadas en el ANEXO II que forma parte integrante de este solicitud de servicio.</p><p class=\"ql-align-justify\"><strong><u>ARTICULO 5°. TURNO DE COSECHA</u></strong>: el turno de cosecha será pactado entre el Ingeniero y/o Enólogo de la Cooperativa y el área de Logística del Servicio, el cual queda formalizado a través de un mail. <span style=\"color: black;\">Si el servicio sufriera un retraso mayor a 4 días se practicará una bonificación sobre el precio final de cosecha.</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong><u>ARTICULO 6°. CONFORMIDAD DE LA COOPERATIVA</u></strong>: En la presente solicitud de servicio presta conformidad la COOPERATIVA, aceptando pagar por cuenta y orden de EL PRODUCTOR el costo del servicio prestado y asumiendo&nbsp;que a su vez FECOVITA lo descuente de la liquidación que a esta le corresponde. En los casos de medio de pago directo del productor a SVE no aplica esta cláusula. </p><p class=\"ql-align-justify\"><strong><u>ARTICULO 7°. FACTURACION Y PAGO DEL SERVICIO:</u> &nbsp;</strong><span style=\"color: black;\">El precio se fija en moneda usd.&nbsp;La facturación se realizará el quinto día hábil del mes posterior a la realización del servicio.&nbsp;Al tratarse de un servicio&nbsp;cotizado en moneda dólar,&nbsp;para proceder a la cancelación total de la factura se deberá entregar pesos equivalentes a la cantidad de dólares adeudada al momento de la facturación, es decir, convirtiendo los dólares adeudados al tipo de cambio vendedor a la fecha de la emisión de la factura.</span></p><p class=\"ql-align-justify\"><span style=\"color: black;\">El&nbsp;monto a cancelar se descuenta de&nbsp;la cuota de vino o pago directo por parte del productor con otro medio de pago habilitado. </span></p><p class=\"ql-align-justify\"><strong><u>ARTICULO 8°. FORMAS DE PAGO </u></strong>: El Servicio podrá pagarse bajo distintas modalidades.</p><p class=\"ql-align-justify\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Descuento de cuota de vino en un pago íntegro </p><p class=\"ql-align-justify\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Financiado&nbsp;en 6 cuotas con descuento de cuota de vino con un recargo del 10%. </p><p class=\"ql-align-justify\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Otros medios de pago, tarjetas de crédito comerciales, tarjetas agro, cheques diferidos. </p><p class=\"ql-align-justify\">Los primeros 3 días hábiles del mes, se deberá informar a SVE la forma de pago elegida por el productor. </p><p class=\"ql-align-justify\">El servicio de cosecha mecánica podrá ser prestado por SVE y ante la imposibilidad del mismo, SVE seleccionará al proveedor más adecuado que asegure la correcta provisión del servicio. El total de hectáreas a facturar serán las indicadas de acuerdo a la lectura del GPS de la máquina. </p><p class=\"ql-align-justify\">Teléfonos de contacto:</p><p class=\"ql-align-justify\">Administración: 261-2746080 &nbsp;</p><p class=\"ql-align-justify\">Logística: 261-6302459</p><p>Mail: <a href=\"mailto:agronomia@sevicoop.com.ar\" rel=\"noopener noreferrer\" target=\"_blank\">agronomia@sevicoop.com.ar</a></p>', 'abierto', 120.00, 120.00, 120.00, 120.00, 120.00, '2025-11-18 14:59:49', '2025-11-26 11:55:45'),
