(18, 'Fosfato Monoamónico', 'fórmula de etiquetado NPK es:  11 = 11 % de Nitrógeno (N)  52 = 52 % de Fósforo (P₂O₅ equivalente)  0 = 0 % de Potasio (K₂O equivalente)  Es un fertilizante soluble que se usa principalmente para aportar fósforo y algo de nitrógeno amoniacal a los cultivos, muy común en agricultura extensiva e intensiva.  Características clave:  Fuente concentrada de fósforo para estimular raíces y floración.  Nitrógeno en forma amoniacal, que se absorbe más lentamente y reduce pérdidas por lixiviación.  Usado tanto en siembra como en fertirriego (si es de grado soluble especial).  pH ligeramente ácido, lo que ayuda a la disponibilidad de nutrientes en suelos alcalinos.', 75361.00, 'Pesos', 'Bolsa de 50 kilos', 'Fertilizantes Sólidos', '10.5'),
